import { Button } from "primereact";
export const ButtonPrimary = ({ handleClick, label, icon, iconPos }) => {
  const handleSubmit = () => {
    handleClick;
  };
  return (
    <Button
      onClick={handleSubmit}
      label={label}
      icon={icon}
      iconPos={iconPos}
    />
  );
};
